.boxFix .boxAuthentication .bgPrimary {
    background-color: #171b2c;
}

.boxFix .boxAuthentication .contentAuthentication {
    position: relative;
    margin-left: auto;
    max-width: 428px;
    height: 100%;
    padding: 2rem;
    -webkit-transform: translateX(428px);
    transform: translateX(428px);
    -webkit-transition: -webkit-transform .3s ease .3s;
    transition: -webkit-transform .3s ease .3s;
    transition: transform .3s ease .3s;
    transition: transform .3s ease .3s,-webkit-transform .3s ease .3s;
    overflow-y: auto;
}

.boxFix .boxAuthentication.show .contentAuthentication {
    -webkit-transform: translateX(0);
    transform: translateX(0);
}

.boxFix .boxAuthentication {
    position: fixed;
    top: 0;
    right: -100%;
    width: 100%;
    height: 100%;
    background-color: rgba(0,0,0,.7);
    z-index: 9999;
    -webkit-transition: opacity .3s ease .3s,left 0s ease .7s;
    transition: opacity .3s ease .3s,left 0s ease .7s;
}

.boxFix .boxAuthentication.show {
    right: 0;
}

